{"time": "21:03 23/03/2020", "content": "THÔNG BÁO VỀ CA BỆNH 123: Bệnh nhân thứ 123 (BN123) là nữ giới, 17 tuổi, trú tại huyện Bình Đại, tỉnh Bến Tre. BN123 sống tại Sarawar, Malaysia được 3-4 tháng nay. Ngày 17/3/2020, bệnh nhân từ Malaysia sang Bandar Seri Begawa - Brunei, lên chuyến bay của hãng hàng không Royal Brunei Airline tới sân bay Tân Sơn Nhất buổi trưa cùng ngày. Bệnh nhân về Bến Tre trên chuyến xe lúc 15h30 chiều ngày 17/3/2020 của nhà xe Công Tạo và được bạn đón về nhà, tự cách ly tại nhà. BN123 đang được chuyển cách ly y tế tại Trung tâm y tế huyện Bình Đại, tỉnh Bến Tre.", "link": "https://ncov.moh.gov.vn/web/guest/dong-thoi-gian"}
